import React, {useState, useEffect} from 'react'
import Card from './Card'

export default function Game() {
  
  // random number for card
  let tempNum = Math.floor(Math.random() * 20 + 1)
  const [ranNum, setRanNum] = useState([tempNum])
  
  useEffect(() => {
    setRandomNum()
  }, [])
  
  
  function setRandomNum () {
    let tempNum = Math.floor(Math.random() * 20 + 1)
    // setRanNum( prevNum => {
    //   if(prevNum.includes(tempNum)){
    //   }
      for (let i = 1; i < 20; i ++){
        console.log(i)
      }
    //   // setRanNum(tempNum)
    //   console.log(prevNum)
    // })
    
  }
  
  // on start -- load images( how many ? ) 
  
  
  
  
  return (
    <div id='game'>
      <div className="row">
        <Card ranNum={ranNum[0]} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
      </div>
      <div className="row">
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
      </div>
      <div className="row">
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
      </div>
      <div className="row">
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
      </div>
      <div className="row">
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
      </div>
      <div className="row">
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
        <Card ranNum={ranNum} setRanNum={setRanNum}/>
      </div>
    </div>
  )
}
